import React, { Component } from 'react';

class Tech extends Component {
  render() {
    return (
      <div style={{"position":"absolute"}}>

        <div style={{"width":"100%","height":"50vh","backgroundColor":"#33466b"}}></div>
        </div>
    )
  }
}

export default Tech;
